import React, { useEffect, useState } from "react";
import "../../App.scss";
import "./Woman.scss";
import TopBar from "../../components/TopBar/TopBar";
import Footer from "../../components/Footer/Footer";
import { Link } from "react-router-dom";

const Woman = () => {
  const [models, setModels] = useState([]);
  const [showMore, setShowMore] = useState(false);

  useEffect(() => {
    const fetchModels = async () => {
      try {
        const response = await fetch("http://127.0.0.1:8000/models/women/?limit=12");
        if (!response.ok) throw new Error("Failed to fetch models");

        const data = await response.json();
        setModels(data.results); // Загружаем модели из API
      } catch (error) {
        console.error("Error fetching models:", error);
      }
    };

    fetchModels();
  }, []);

  return (
    <>
      <div className="woman-page">
        <TopBar />
      </div>

      <main className="main">
        <section className="our-models woman-models">
          <div className="our-models__title">
            <h2 className="our-models__title-text">Women Models</h2>
          </div>

          <Link to="/filter">
            <div className="filter">
              <div className="filter__text">Filter</div>
              <div>
                <img src="/icons/woman/icon-filter.svg" alt="icon filter" className="filter__icon" />
              </div>
            </div>
          </Link>

          {/* Первые 6 моделей */}
          <div className="our-models__block">
            {models.slice(0, 6).map((model, index) => (
              <Link to={model.detail_url || "/"} key={index} className="our-models__link">
                <div className="our-models__card">
                  <div className="our-models__img">
                    <img src={model.image_url} alt={model.full_name || "Model"} />
                  </div>
                  <div className="our-models__info">
                    <div className="our-models__name">{model.full_name || "Loading..."}</div>
                    <div className="our-models__location">
                      {model.city || "City"}, {model.country || "Country"}
                    </div>
                  </div>
                </div>
              </Link>
            ))}
          </div>
        </section>
      </main>

      <Footer />
    </>
  );
};

export default Woman;
